import React, { Component } from "react";
import CoLinkName from './Components/CoLinkName'
import "./Nav.scss"

class Nav extends Component {
  constructor() {
    super();
    this.state = {
      linkCoName: [],
      mainCategory: [],
    }
  }
  componentDidMount() {
    // 코퍼레이션 링크
    fetch('http://localhost:3000/data/LinkCoData.json', {
      method: 'GET'
    })
      .then(res => res.json())
      .then(res => {
        this.setState({
          linkCoName: res.LinkCoData
        });
      });
      // 메인 카테고리 데이터
      fetch('http://localhost:3000/data/MainCategory.json', {
      method: 'GET'
    })
      .then(res => res.json())
      .then(res => {
        this.setState({
          mainCategory: res.MainCategory
        });
      });
  }
  render() {
    return (
    <header className="Nav">
      <div className="header">
         <ul className="coLists">    
          {this.state.linkCoName.map(el => 
            <CoLinkName 
            key={el.id}
            linkDataId={el.id}
            linkDataName={el.coName}/>
            )}
         </ul>

          <ul className="myMenuLists">
            <li className="myMenuList">

                <span className="linkMyMenuName">
                  <a className="linkMyMenu" href="www">회원가입</a> 
                  <span className="linkNull" >/</span>
                  <a className="linkMyMenu" href="www">로그인</a>
                </span>

            </li>
            <li className="myMenuList">
              <a className="linkMyMenu" href="www">
                <span className="linkMyMenuName">
                  고객센터
                </span>
              </a>
            </li>
            <li className="myMenuList">
              <a className="linkMyMenu" href="www">
                <span className="linkMyMenuName">
                  장바구니 아이콘
                </span>
              </a>
            </li>
            <li className="myMenuList">
              <a className="linkMyMenu" href="www">
                <span className="linkMyMenuName">
                  위치
                </span>
              </a>
            </li>
          </ul>
        </div>
      <nav className="navMain">

        <a className="mainLogoLink" href>
          <span className="mainLogoImg">
          <svg class="pre-logo-svg" height="60px" width="60px" fill="#111" viewBox="0 0 69 32">
            <path d="M68.56 4L18.4 25.36Q12.16 28 7.92 28q-4.8 0-6.96-3.36-1.36-2.16-.8-5.48t2.96-7.08q2-3.04 6.56-8-1.6 2.56-2.24 5.28-1.2 5.12 2.16 7.52Q11.2 18 14 18q2.24 0 5.04-.72z"></path>
            </svg>
          </span>
        </a>

        <ul className="mainCategoryList">
          <li className="mainCategoryItem">
            <a className="mainCategoryLink" href>
            NEW RELLEASES
            </a>
          </li>
          <li className="mainCategoryItem">
            <a className="mainCategoryLink" href>
           MEN
            </a>
          </li>
          <li className="mainCategoryItem">
            <a className="mainCategoryLink" href>
            WOMEN
            </a>
          </li>
          <li className="mainCategoryItem">
            <a className="mainCategoryLink" href>
            KIDS
            </a>
          </li>
        </ul>

        <span className="mainInputName">
          <input className="mainInput" placeholder="검색">
            <button>
            <svg class="pre-search-input-icon" fill="#111" height="30px" width="30px" viewBox="0 0 24 24"><path d="M21.71 20.29L18 16.61A9 9 0 1 0 16.61 18l3.68 3.68a1 1 0 0 0 1.42 0 1 1 0 0 0 0-1.39zM11 18a7 7 0 1 1 7-7 7 7 0 0 1-7 7z"></path></svg>
            </button>
          </input>
          </span>

      </nav>

    </header>
    )
  }
}
export default Nav;
